#include <stdlib.h>
#include <stdio.h>
#include "defs.h"

i8 index(i8 x, i8 y) {
    switch (x) {
        case -4:
            return 0; // y = 0
        case -3:
            return 1 + (y+1); // -1 <= y <= 1
        case -2:
            return 4 + (y+2); // -2 <= y <= 2
        case -1:
            return 9 + (y+3); // ...
        case 0:
            return 16 + (y+4);
        case 1:
            return 25 + (y+3);
        case 2:
            return 32 + (y+2);
        case 3:
            return 37 + (y+1);
        case 4:
            return 40;
        default:
            return -1; // should never happen
    }
}

i64 bit(i8 x, i8 y) {
    return 1 << index(x, y);
}

i64 toBitmap(Cell* cell) {
    i64 result = 0;
    while (cell != NULL) {
        result |= bit(cell->x, cell->y);
        cell = cell->next;
    }
    return result;
}

Placement* addPlacement(Cell* cells, Placement* next) {
    Placement* newNode = malloc(sizeof(Placement));
    newNode->cells = cells;
    newNode->bitmap = toBitmap(cells);
    newNode->next = next;
    return newNode;
}

void destroyPlacements(Placement* node) {
    Placement* next = node->next;
    free(node);
    while(next != NULL) {
       node = next;
       next = node->next;
       free(node);
    }
}

